import * as React from "react";
import "../css/friendslist.css";

interface FriendsListProps {}

const FriendsList: React.FunctionComponent<FriendsListProps> = () => {
  return (
    <div className="friendslist-container">
      <div className="chat-container">
        <div className="profile-container">
          <img src="" alt="profile-image" />
        </div>
        <div className="info-container">
          <div className="chatname-container">Name Naminovici</div>
          <div className="chatmessage-container">
            <div className="message-container">
              Hello message from our workers..
            </div>
            <div className="timemessage-container">12m</div>
          </div>
        </div>
        <div className="online-box">3</div>
      </div>
    </div>
  );
};

export default FriendsList;
